        <FormControl>
            <InputLabel>Salary</InputLabel>
            <Input name='salary'/>
        </FormControl>
        <FormControl>
            <Button variant='contained'>Add User</Button>
        </FormControl>
    </Container>
 )
}
export default AddUser
